// App.js

import React from 'react';
import { BrowserRouter as Router, Route, Link, Switch as RouterSwitch } from 'react-router-dom'; // Rename Switch to RouterSwitch
import StoreDataPage from './StoreDataPage';
import FetchDataPage from './FetchDataPage';

function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/store">Store Data</Link>
            </li>
            <li>
              <Link to="/fetch">Fetch Data</Link>
            </li>
          </ul>
        </nav>
        <RouterSwitch>
          <Route path="/store">
            <StoreDataPage />
          </Route>
          <Route path="/fetch">
            <FetchDataPage />
          </Route>
        </RouterSwitch>
      </div>
    </Router>
  );
}

export default App;
